description:
Les données concernent :   
  * les subventions globales de fonctionnement attribuées aux organismes de formations du secteur paramédical ou maïeutique (sanitaire) et aux organismes de formations du secteur social ;   
  * les subventions de fonctionnement attribuées aux centres de formations non décentralisés pour le financement de places en formation continue pour les formations aide-soignant et/ou auxiliaire de puériculture.

Les données concernent : 
  * les subventions globales de fonctionnement attribuées aux organismes de formations du secteur paramédical ou maïeutique (sanitaire) et aux organismes de formations du secteur social ; 
  * les subventions de fonctionnement attribuées aux centres de formations non décentralisés pour le financement de places en formation continue pour les formations aide-soignant et/ou auxiliaire de puériculture.

La base permanente des équipements (BPE), produite par l'INSEE, est destinée à fournir le niveau d'équipement et de services rendus par un territoire à la population.
Ce jeu de données dénombre les  fonctions médicales et paramédicales au niveau communal (arrondissement de Paris et commune).
 **Liste des variables :**
  * Médecin omnipraticien ;
  * Spécialiste en cardiologie ;
  * Spécialiste en dermatologie vénéréologie ;
  * Spécialiste en gynécologie médicale ;
  * Spécialiste en gynécologie obstétrique ;
  * Spécialiste en gastro-entérologie hépatologie ;
  * Spécialiste en psychiatrie ;
  * Spécialiste en ophtalmologie ;
  * Spécialiste en oto-rhino-laryngologie ;
  * Spécialiste en pédiatrie ;
  * Spécialiste en pneumologie ;
  * Spécialiste en radiodiagnostic et imagerie médicale ;
  * Spécialiste en stomatologie ;
  * Chirurgien dentiste ;
  * Sage-femme ;
  * Infirmier ;
  * Masseur kinésithérapeute ;
  * Orthophoniste ;
  * Orthoptiste ;
  * Pédicure-podologue ;
  * Audio prothésiste ;
  * Ergothérapeute ;
  * Psychomotricien.

La base permanente des équipements (BPE), produite par l'INSEE, est destinée à fournir le niveau d'équipement et de services rendus par un territoire à la population.
Ce jeu de données dénombre les service de santé au niveau communal (arrondissement de Paris et commune).
 **Liste des variables :**
  *  _Établissement et services de santé_  
    * Établissement santé court séjour ;
    * Établissement santé moyen séjour ;
    * Établissement santé long séjour ;
    * Établissement psychiatrique ;
    * Centre lutte cancer ;
    * Urgences ;
    * Maternité ;
    * Centre de santé ;
    * Structures psychiatriques en ambulatoire ;
    * Centre médecine préventive ;
    * Dialyse ;
    * Hospitalisation à domicile ;
  *  _Autres établissements et services à caractère sanitaire_
    * Pharmacie ;
    * Laboratoire d'analyses médicales ;
    * Ambulance ;
    * Transfusion sanguine ;
    * Établissement thermal ;
    * Établissement de lutte contre l'alcoolisme.

La base permanente des équipements (BPE), produite par l'INSEE, est destinée à fournir le niveau d'équipement et de services rendus par un territoire à la population.
Ce jeu de données dénombre les équipements dans le domaine du tourisme et du transport au niveau communal (arrondissement de Paris et commune).
 **Liste des variables :**
 **  
**
  *  _Transports et déplacements_  
    * Taxi ;
    * Aéroport - nombre de passagers ;
    * Gare avec TGV (train à grande vitesse) ;
    * Gare sous convention avec les conseils régionaux ou les STIF ;
  * _Tourisme_
    * Agence de voyage ;
    * Hôtel homologué ;
    * Hôtel homologué - nombre de chambres ;
    * Camping homologué ;
    * Camping homologué - nombre d'emplacements ;
    * Services de réservation et d'information touristique.

La base permanente des équipements (BPE), produite par l'INSEE, est destinée à fournir le niveau d'équipement et de services rendus par un territoire à la population.  
Ce jeu de données recouvre les domaines des services aux particuliers.
**Liste des variables**
  * _Services publics_
    * Police ;
    * Trésorerie ;
    * Agence de proximité Pôle emploi ;
    * Relais Pôle emploi ;
    * Permanence Pôle emploi ;
    * Agence de services spécialisés ;
    * Agence thématique ;
    * Gendarmerie ;
    * Cour d’appel ;
    * Tribunal de grande instance ;
    * Tribunal d’instance ;
    * Conseil de prud’hommes ;
  *  _Services généraux_
    * Tribunal de commerce ;
    * Banque, Caisse d'Épargne ;
    * Pompes funèbres ;
    * Bureau de poste ;
    * Relais poste commerçant ;
    * Agence postale communale ;
  *  _Services automobiles_
    * Réparation auto et de matériel agricole ;
    * Contrôle technique automobile ;
    * Location auto-utilitaires légers ;
    * École de conduite ;
  * Artisanat du bâtiment
    * Maçon ;
    * Plâtrier peintre ;
    * Menuisier, charpentier, serrurier ;
    * Plombier, couvreur, chauffagiste ;
    * Électricien ;
    * Entreprise générale du bâtiment ;
  *  _Autres services à la population_
    * Coiffure ;
    * Vétérinaire ;
    * Agence de travail temporaire ;
    * Restaurant ;
    * Agence immobilière ;
    * Blanchisserie-Teinturerie ;
    * Soins de beauté.

Liste des établissements et services pour personnes âgées situés en Île-de-France (source FINESS /15-05-2013) et géolocalisation :
  * établissements d'Hébergement pour Personnes Âgées (hospices, maisons de retraites, logement, accueil temporaire) ;
  * services sanitaires de maintien à domicile (centres de jour) ;
  * services sociaux (foyers clubs restaurants,aide ménagère à domicile, alarme médico-sociale, repas à domicile, services d'aides) ;
  * établissements expérimentaux en faveur des personnes âgées
